<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.01//EN" "http://www.w3.org/TR/html4/strict.dtd">
<html>
<head>
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
  <meta http-equiv="Content-Style-Type" content="text/css">
  <title>{% if page.title %}{{ page.title }} | {% endif %}{{ site.title | default: site.github.repository_name }} by {{ site.github.owner_name }}</title>
  <meta name="Description" content="{{ page.description | default: site.description | default: site.github.project_tagline }}">
  <meta name="Generator" content="Cocoa HTML Writer">
  <meta name="CocoaVersion" content="1348.17">
  <style type="text/css">
    p.p2 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Times; color: #000000; -webkit-text-stroke: #000000}
    span.s1 {font-kerning: none}
    span.s2 {font: 12.0px Times; text-decoration: underline ; font-kerning: none; color: #0000ee; -webkit-text-stroke: 0px #0000ee}
  </style>
</head>
<body>
<h1 style="margin: 0.0px 0.0px 14.9px 0.0px; font: 18.0px Times; color: #000000; -webkit-text-stroke: #000000"><span class="s1"><b>{{ site.title | default: site.github.repository_name }}</b></span></h1>
<h2 style="margin: 0.0px 0.0px 14.9px 0.0px; font: 18.0px Times; color: #000000; -webkit-text-stroke: #000000"><span class="s1"><b>Stanford University, Fall 2019</b></span></h2>
<p class="p2"><span class="s1">{% if site.show_downloads %} <a href="file:///Users/Joe/Desktop/%7B%7B%20site.github.zip_url%20%7D%7D"><span class="s2">Download .zip</span></a> <a href="file:///Users/Joe/Desktop/%7B%7B%20site.github.tar_url%20%7D%7D"><span class="s2">Download .tar.gz</span></a> {% endif %}<span class="Apple-converted-space"> </span></span></p>
<p class="p2"><span class="s1">{{ content }}</span></p>
<p class="p2"><span class="s1">This page was generated by <a href="https://pages.github.com/"><span class="s2">GitHub Pages</span></a>.<span class="Apple-converted-space"> </span></span></p>
<p class="p2"><span class="s1">{% if site.google_analytics %} {% endif %}<span class="Apple-converted-space"> </span></span></p>
</body>
</html>
